import {Button} from 'react-bootstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <Button variant="outline-primary">Primary</Button>{' '}
      <Button variant="secondary">Secondary</Button>{' '}
    </div>
  );
}

export default App;
